INSERT INTO `exercise_descriptor_i18n` VALUES (1,'de_DE','Kann ein kurzes, eingeübtes Statement verlesen, um z. B. einen Redner vorzustellen oder einen Toast auszubringen'),(1,'en_US','Can read a very short, rehearsed statement – e.g. to introduce a speaker, propose a toast'),(1,'es_ES','Es capaz de leer un comunicado breve y previamente ensayado; por ejemplo, presentar a un hablante o proponer un brindis'),(1,'fr_FR','Peut lire un texte très bref et répété, par exemple pour présenter un conférencier, proposer un toast'),(2,'de_DE','Kann jemanden vorstellen und einfache Gruß- und Abschiedsformeln gebrauchen'),(2,'en_US','Can make an introduction and use basic greeting and leave-taking expressions'),(2,'es_ES','Se presenta y utiliza saludos y expresiones de despedida básicos'),(2,'fr_FR','Peut présenter quelqu\'un et utiliser des expressions élémentaires de salutation et de congé'),(3,'de_DE','Kann jemanden nach dem Befinden fragen und auf Neuigkeiten reagieren'),(3,'en_US','Can ask how people are and react to news'),(3,'es_ES','Pregunta cómo están las personas y expresa sus reacciones ante las noticias'),(3,'fr_FR','Peut demander à quelqu\'un de ses nouvelles et y réagir'),(4,'de_DE','Kann sich selbst beschreiben und sagen, was er/sie beruflich tut und wo er/sie wohnt'),(4,'en_US','Can describe him/herself, what he/she does and where he/she lives'),(4,'es_ES','Es capaz de describirse a sí mismo, hablar de su profesión y de su lugar de residencia'),(4,'fr_FR','Peut se décrire, décrire ce qu\'il/elle fait, ainsi que son lieu d\'habitation'),(5,'de_DE','KANN einfache, sachliche Fragen stellen und die Antworten verstehen, soweit diese in einfacher Sprache gegeben werden (z. B. \"Wo ist der Speisesaal?\" \"Er ist im ersten Stock\" usw.)'),(5,'en_US','CAN ask simple questions of a factual nature and understand the answers provided these are expressed in simple language (for example, \'Where is the dining-room?\' \'It\'s on the first floor\', etc.)'),(5,'es_ES','PUEDE hacer preguntas sencillas, de naturaleza objetiva, y comprender las respuestas siempre que estén expresadas en lenguaje sencillo (por ej. \"¿Dónde está el comedor?\" \"Está en el primer piso.\", etc.)'),(5,'fr_FR','EST CAPABLE de poser des questions d\'ordre pratique et comprendre les réponses si elles sont exprimées dans un langage simple (par exemple, \"Où est la salle à manger ?\" \"Elle est au premier étage\", etc.)'),(6,'de_DE','KANN einfache Beschwerden äußern, z. B. \"Das Wasser ist kalt\"'),(6,'en_US','CAN make simple complaints, for example \'The water is cold\''),(6,'es_ES','PUEDE formular quejas sencillas, por ejemplo, \"El agua está fría\"'),(6,'fr_FR','EST CAPABLE de formuler des réclamations simples comme \"L\'eau est froide\"'),(7,'de_DE','KANN eine Notrufnummer anwählen, den Ort angeben und um Hilfe bitten'),(7,'en_US','CAN call an emergency number, give location and ask for relevant service'),(7,'es_ES','PUEDE llamar por teléfono a un número de emergencia, pedir el servicio que necesite y dar su dirección'),(7,'fr_FR','EST CAPABLE d\'appeler un numéro d\'urgence, de donner l\'adresse et demander le service requis'),(8,'de_DE','Kann etwas erzählen oder in Form einer einfachen Aufzählung berichten'),(8,'en_US','Can tell a story or describe something in a simple list of points'),(8,'es_ES','Narra historias o describe algo mediante una relación sencilla de elementos'),(8,'fr_FR','Peut raconter une histoire ou décrire quelque chose par une simple liste de points'),(9,'de_DE','Kann über Aspekte des eigenen alltäglichen Lebensbereichs berichten, z. B. über Leute, Orte, Erfahrungen in Beruf oder Ausbildung'),(9,'en_US','Can describe everyday aspects of his/her environment e.g. people, places, a job or study experience'),(9,'es_ES','Describe aspectos cotidianos de su entorno; por ejemplo, personas, lugares, una experiencia de trabajo o de estudio'),(9,'fr_FR','Peut décrire les aspects de son environnement quotidien tels que les gens, les lieux, l\'expérience professionnelle ou scolaire'),(10,'de_DE','Kann kurz und einfach über ein Ereignis oder eine Tätigkeit berichten'),(10,'en_US','Can give short, basic descriptions of events and activities'),(10,'es_ES','Realiza descripciones breves y básicas de hechos y actividades'),(10,'fr_FR','Peut faire une description brève et élémentaire d\'un événement ou d\'une activité '),(11,'de_DE','Kann Pläne und Vereinbarungen, Gewohnheiten und Alltagsbeschäftigungen beschreiben sowie über vergangene Aktivitäten und persönliche Erfahrungen berichten'),(11,'en_US','Can describe plans and arrangements, habits and routines, past activities and personal experiences'),(11,'es_ES','Describe planes y citas, costumbres, actividades habituales o pertenecientes al pasado y experiencias personales'),(11,'fr_FR','Peut décrire des projets et préparatifs, des habitudes et occupations journalières, des activités passes et des expériences personnelles'),(12,'de_DE','Kann mit einfachen Mitteln Gegenstände sowie Dinge, die ihm/ihr gehören, kurz beschreiben und vergleichen'),(12,'en_US','Can use simple descriptive language to make brief statements about and compare objects and possessions'),(12,'es_ES','Utiliza un lenguaje sencillo y descriptivo para realizar breves declaraciones sobre objetos y posesiones y para hacer comparaciones'),(12,'fr_FR','Peut décrire et comparer brièvement, dans une langue simple, des objets et choses lui appartenant'),(13,'de_DE','Kann erklären, was er/sie an etwas mag oder nicht mag'),(13,'en_US','Can explain what he/she likes or dislikes about something'),(13,'es_ES','Explica lo que le gusta y lo que no le gusta respecto a algo'),(13,'fr_FR','Peut expliquer en quoi une chose lui plait ou lui déplaît'),(14,'de_DE','KANN im Restaurant die Bedienung höflich rufen und ein Essen bestellen'),(14,'en_US','CAN get the attention of staff in an appropriate way and order a meal in a restaurant'),(14,'es_ES','PUEDE conseguir la atención de los camareros de manera apropiada y pedir une comida en un restaurante'),(14,'fr_FR','EST CAPABLE d\'attirer correctement l\'attention des serveurs et commander un repas'),(15,'de_DE','KANN einfache Fragen über die Speisekarte stellen und einfache Antworten verstehen'),(15,'en_US','CAN ask simple questions about the menu and understand simple answers'),(15,'es_ES','PUEDE hacer preguntas sencillas sobre la carta y comprender respuestas sencillas'),(15,'fr_FR','EST CAPABLE de poser des questions simples sur le menu et comprendre des réponses simples'),(16,'de_DE','KANN seine Meinung über das Essen äußern'),(16,'en_US','CAN express an opinion about food'),(16,'es_ES','PUEDE expresar de forma muy sencilla une opinión sobre la comida'),(16,'fr_FR','EST CAPABLE d\'exprimer une opinion sur la nourriture'),(17,'de_DE','KANN einfache Beschwerden äußern, z. B. \"Das Essen ist kalt\"'),(17,'en_US','CAN make simple complaints, for example, \'The food is cold\''),(17,'es_ES','PUEDE formular quejas muy simples, por ej., \"La comida está fría\"'),(17,'fr_FR','EST CAPABLE de formuler des réclamations simples comme \"Le plat est froid\"'),(18,'de_DE','KANN nach dem fragen, was er/sie möchte, wenn der Verkäufer es gleich versteht'),(18,'en_US','CAN ask for what is required, if it is something which the shopkeeper can readily understand'),(18,'es_ES','PUEDE pedir lo que necesita, si es algo que el dependiente puede comprender fácilmente'),(18,'fr_FR','EST CAPABLE de demander ce qu\'il désire s\'il s\'agit de quelque chose que le vendeur peut comprendre immédiatement'),(19,'de_DE','Kann in Geschäften, Postämtern, Banken nach etwas fragen und einfache Erledigungen machen'),(19,'en_US','Can ask about things and make simple transactions in shops, post offices or banks'),(19,'es_ES','Pregunta sobrecosas y realiza transacciones sencillas en tiendas, oficinas de correo o bancos'),(19,'fr_FR','Peut poser des questions et effectuer des transactions simples dans un magasin, un bureau de poste, une banque'),(20,'de_DE','Kann Informationen über M