PUEDE realizar una presentación o demostración corta y sencilla sobre un tema conocido'),(111,'fr_FR','EST CAPABLE de faire une présentation courte et simple sur un thème familier'),(112,'de_DE','KANN mit Einschränkungen an einem Seminar oder Kurs teilnehmen, vorausgesetzt, daß der Dozent auf ihn/sie eingeht und eine einfache Sprache benutzt'),(112,'en_US','CAN take a limited part in a seminar or tutorial, provided that this is conducted sympathetically, using simple language'),(112,'es_ES','PUEDE participar de forma limitada en un seminario o tutoría, siempre que exista un deseo de colaborar y se utilice un lenguaje sencillo'),(112,'fr_FR','EST CAPABLE de participer de façon limitée à un séminaire ou à des travaux dirigés s\'ils sont conduits avec bienveillance en utilisant un langage simple'),(113,'de_DE','Kann an routinemäßigen formellen Diskussionen über vertraute Themen teilnehmen, bei denen es darum geht, Sachinformationen auszutauschen, Anweisungen entgegenzunehmen oder Lösungsmöglichkeiten für praktische Probleme zu diskutieren, sofern deutlich gesprochen und Standardsprache verwendet wird'),(113,'en_US','Can take part in routine formal discussion of familiar subjects which is conducted in clearly articulated speech in the standard dialect and which involves the exchange of factual information, receiving instructions or the discussion of solutions to practical problems'),(113,'es_ES','Es capaz de tomar parte en discusiones formales habituales sobre temas cotidianos cuando la lengua está articulada con claridad en nivel estándar, también puede tomar parte en discusiones que suponen un intercambio de información sobre hechos concretos o en las que se dan instrucciones o soluciones a problemas práctico'),(113,'fr_FR','Peut prendre part à une discussion formelle courante sur un sujet familier conduite dans une langue standard clairement articulée et qui suppose l\'échange d\'informations factuelles, en recevant des instructions ou la discussion de solutions à des problèmes pratiques'),(114,'de_DE','KANN um Erläuterung bitten, aber die Erläuterung muß \"wohlwollend\" gegeben werden, damit sie verstanden werden kann'),(114,'en_US','CAN ask for clarification, but this needs to be given sympathetically in order for it to be understood'),(114,'es_ES','PUEDE pedir aclaraciones, pero dicha aclaración deberá adaptarse a su capacidad de comprensión para que la entienda'),(114,'fr_FR','EST CAPABLE de demander des éclaircissements mais ils devront être donnés avec bienveillance pour être compris'),(115,'de_DE','Kann einen Standpunkt klar machen, hat aber Schwierigkeiten wenn er/sie sich auf eine Debatte einlässt'),(115,'en_US','Can put over a point of view clearly, but has difficulty engaging in debate'),(115,'es_ES','Puede plantear un punto de vista con claridad, pero le resulta difícil participar en el debate'),(115,'fr_FR','Peut exprimer clairement un point de vue mais a du mal à engager un débat'),(116,'de_DE','Kann erklären, warum etwas ein Problem ist, kann diskutieren, was man als Nächstes tun sollte, und kann Alternativen vergleichen und einander gegenüberstellen'),(116,'en_US','Can explain why something is a problem, discuss what to do next, compare and contrast alternatives'),(116,'es_ES','Explica los motivos de un problema, discute sobre los pasos que se deben seguir, compara y contrasta alternativas'),(116,'fr_FR','Peut expliquer pourquoi quelque chose pose problème, discuter de la suite à donner, comparer et opposer les solutions'),(117,'de_DE','Kann die Standpunkte anderer kurz kommentieren'),(117,'en_US','Can give brief comments on the views of others'),(117,'es_ES','Realiza breves comentarios sobre los puntos de vista de otras persona'),(117,'fr_FR','Peut commenter brièvement le point de vue d\'autrui'),(118,'de_DE','Kann eine kurze Geschichte, einen Artikel, einen Vortrag, ein Interview oder eine Dokumentarsendung zusammenfassen, dazu Stellung nehmen und Informationsfragen dazu beantworten'),(118,'en_US','Can summarise and give his or her opinion about a short story, article, talk, discussion, interview, or documentary and answer further questions of detail'),(118,'es_ES','Resume y da su opinión sobre relatos, artículos, charlas, discusiones, entrevistas o documentales breves, y responde a preguntas complementarias que requieren detalles'),(118,'fr_FR','Peut résumer – en donnant son opinion – un bref récit, un article, un exposé, une discussion, une interview ou un documentaire et répondre à d\'éventuelles questions complémentaires de détail'),(119,'de_DE','KANN eine klare Präsentation über ein vertrautes Thema geben'),(119,'en_US','CAN give a clear presentation on a familiar topic'),(119,'es_ES','PUEDE realizar una presentación clara sobre un tema conocido'),(119,'fr_FR','EST CAPABLE de présenter clairement un thème familier'),(120,'de_DE','KANN vorhersehbare und faktische Fragen beantworten'),(120,'en_US','CAN answer predictable or factual questions'),(120,'es_ES','PUEDE responder a preguntas previsibles o de carácter objetivo'),(120,'fr_FR','EST CAPABLE de répondre à des questions courantes et factuelles'),(121,'de_DE','KANN überprüfen, daß er/sie die Anweisungen richtig verstanden hat'),(121,'en_US','CAN check that all instructions are understood'),(121,'es_ES','PUEDE comprobar que ha entendido todas las indicaciones'),(121,'fr_FR','EST CAPABLE de vérifier que toutes les indications sont comprises'),(122,'de_DE','Kann seine/ihre Gedanken und Meinungen präzise ausdrücken, überzeugend argumentieren und auf komplexe Argumentationen anderer reagieren'),(122,'en_US','Can express his/her ideas and opinions with precision, present and respond to complex lines of argument convincingly'),(122,'es_ES','Expresa sus ideas y opiniones con precisión, presenta líneas argumentales complejas y responde a ellas con convicción'),(122,'fr_FR','Peut exprimer ses idées et ses opinions avec précision et argumenter avec conviction sur des sujets complexes et réagir de même aux arguments d\'autrui'),(123,'de_DE','Kann eine Angelegenheit oder ein Problem klar darlegen, dabei Vermutungen über Ursachen und Folgen anstellen und die Vor- und Nachteile verschiedener Ansätze gegeneinander abwägen'),(123,'en_US','Can outline an issue or a problem clearly, speculating about causes or consequences, and weighing advantages and disadvantages of different approaches'),(123,'es_ES','Esboza un asunto o un problema con claridad, especulando sobre las causas o consecuencias y comparando las ventajas y desventajas de diferentes enfoques'),(123,'fr_FR','Peut esquisser clairement à grands traits une question ou un problème, faire des spéculations sur les causes et les conséquences, et mesurer les avantages et les inconvénients des différentes approches'),(124,'de_DE','Kann Informationen und Argumente aus verschiedenen Quellen zusammenfassen und wiedergeben'),(124,'en_US','Can synthesise and report information and arguments from a number of sources'),(124,'es_ES','Sintetiza y comunica información y argumentos procedentes de varias fuentes'),(124,'fr_FR','Peut faire la synthèse d\'informations et d\'arguments issus de sources différentes et en rendre compte'),(125,'de_DE','KANN Fragen stellen, z. B. nach Ursachen, Erläuterungen etc.'),(125,'en_US','CAN ask questions, for example for reasons, clarification etc.'),(125,'es_ES','PUEDE hacer preguntas, por ejemplo para pedir razones, aclaraciones, etc.'),(125,'fr_FR','EST CAPABLE de poser des questions concernant, par exemple, des motifs de demander, des éclaircissements, etc.'),(126,'de_DE','KANN Kritik zurückweisen, ohne beleidigend zu wirken'),(126,'en_US','CAN rebut criticisms without causing offence'),(126,'es_ES','PUEDE rebatir las críticas sin ofender'),(126,'fr_FR','EST CAPABLE de faire face aux critiques sans agressivité'),(127,'de_DE','KANN zusammenhängende Erläuterungen theoretischer Art geben'),(127,'en_US','CAN give coherent explanations of a theoretical nature'),(127,'es_ES','PUEDE dar explicaciones coherentes de carácter teórico'),(127,'fr_FR','EST CAPABLE de donner des explications théoriques cohérentes'),(128,'de_DE','KANN eine erfolgreiche Präsentation oder Demonstration geben'),(128,'en_US','CAN give an effective presentation or demonstration'),(128,'es_ES','PUEDE realizar una presentación o demonstración efectiva'),(128,'fr_FR','EST CAPABLE de faire efficacement une présentation ou une démonstration'),(129,'de_DE','KANN unvorhersehbare Fragen faktischer Art beantworten'),(129,'en_US','CAN answer unpredictable questions of a factual nature'),(129,'es_ES','PUEDE responder a preguntas imprevisibles de carácter objetivo'),(129,'fr_FR','EST CAPABLE de répondre à des questions imprévues qui portent sur des faits'),(130,'de_DE','KANN alle Vereinbarungen treffen, die für die praktische Durchführung des Studiums innerhalb und außerhalb des Klassenzimmers notwendig sind, d. h. mit Lehrern, Dozenten, Labor- und Bibliothekspersonal etc.'),(130,'en_US','CAN make all necessary arrangements regarding practical arrangements for study in or out of classroom with teachers, lecturers, lab and library staff, etc.'),(130,'es_ES','PUEDE ponerse de acuerdo con profesores, personal de biblioteca, laboratorio, etc para cualquier cuestión relacionada con el estudio dentro y fuera del aula'),(130,'fr_FR','EST CAPABLE de prendre toutes les dispositions nécessaires pour l\'organisation pratique du travail en classe ou hors de la classe avec les enseignants et le personnel du laboratoire et de la bibliothèque'),(131,'de_DE','KANN Fragen, wenn sie mißverstanden wurden, umformulieren'),(131,'en_US','CAN reformulate questions if misunderstood'),(131,'es_ES','PUEDE reformular sus preguntas si no le comprenden'),(131,'fr_FR','EST CAPABLE de reformuler des questions si elles sont mal comprises'),(132,'de_DE','KANN Kritik äußern/einen anderen Standpunkt einnehmen, ohne beleidigend zu wirken'),(132,'en_US','CAN make critical remarks / express disagreement without causing offence'),(132,'es_ES','PUEDE hacer comentarios críticos/expresar su desacuerdo sin ofender'),(132,'fr_FR','EST CAPABLE de faire des remarques critiques, d\'exprimer son désaccord sans offenser les autres'),(133,'de_DE','KANN aktiv an den meisten Seminaren oder Kursen teilnehmen'),(133,'en_US','CAN take an active part in most kinds of seminars or tutorials'),(133,'es_ES','PUEDE participar de forma active en la mayoría de los diferentes seminarios o tutorías.  '),(133,'fr_FR','EST CAPABLE de participer à la plupart des séminaires ou travaux dirigés'),(134,'de_DE','KANN seinen Sprechanteil am Gespräch behaupten'),(134,'en_US','CAN get and hold on to his/her turn to speak'),(134,'es_ES','PUEDE tomar la palabra y mantenerla'),(134,'fr_FR','EST CAPABLE de prendre son tour de parole et de le garder'),(135,'de_DE','KANN Gegenargumente zurückweisen'),(135,'en_US','CAN rebut counter-arguments'),(135,'es_ES','PUEDE rebatir argumentos contrarios.  '),(135,'fr_FR','EST CAPABLE de réfuter des contre-arguments'),(136,'de_DE','Kann in einem Interviewgespräch einfache, direkte Fragen zur Person beantworten, wenn die Fragen langsam, deutlich und in direkter, nicht-idiomatischer Sprache gestellt werden'),(136,'en_US','Can reply in an interview to simple direct questions spoken very slowly and clearly in direct non-idiomatic speech about personal details'),(136,'es_ES','Responde en una entrevista a preguntas sencillas y directas sobre datos personales, si se habla muy despacio y con claridad sin modismos ni frases hechas'),(136,'fr_FR','Peut répondre dans un entretien à des questions personnelles posées très lentement et clairement dans une langue directe et non idiomatique'),(137,'de_DE','KANN dem Kunden einfache Hilfe anbieten, z. B. \"Ich gebe Ihnen unseren neuen Katalog\"'),(137,'en_US','CAN offer some help to a client/customer, for example, \'I\'ll give you our new catalogue\''),(137,'es_ES','PUEDE ofrecer ayuda a un cliente, por ejemplo, \"Este es nuestro nuevo catálogo\"'),(137,'fr_FR','EST CAPABLE de proposer de l\'aide à un client, par exemple \"Je vais vous donner notre nouveau catalogue\"'),(138,'de_DE','KANN innerhalb seines/ihres eigenen Arbeitsgebiets einfache Bedürfnisse äußern, z. B. \"Ich möchte 25... bestellen.\"  '),(138,'en_US','CAN state simple requirements within own job area, for example \'I want to order 25 of...\''),(138,'es_ES','PUEDE expresar peticiones muy sencillas dentro de su propio ámbito de trabajo, por ejemplo \"Quiero pedir 25…\"'),(138,'fr_FR','EST CAPABLE de formuler des demandes simples concernant son travail, comme \"Je voudrais commander 25 unités de...\"'),(139,'de_DE','KANN sich äußern zu alltäglichen, vorhersehbaren Vorgängen, z.B. wenn diese nur eine einfache Diskussion verlangen wie \"Das wäre besser, weil...\"'),(139,'en_US','CAN exchange opinions on familiar, predictable matters, for example, involving straightforward discussions of the \'This is better because...\' type'),(139,'es_ES','PUEDE intercambiar opiniones sobre temas conocidos, previsibles, por ejemplo, mediante argumentaciones sencillas del tipo \"Esto es mejor porque…\"'),(139,'fr_FR','EST CAPABLE d\'échanger des points de vue sur des sujets courants du moment que les discussions ne dépassent pas le cadre de \"Ceci est mieux parce que...\"'),(140,'de_DE','Kann diskutieren, was man als Nächstes tun sollte, kann Vorschläge machen und auf Vorschläge reagieren, kann um Anleitungen bitten und Anleitungen geben'),(140,'en_US','Can discuss what to do next, making and responding to suggestions, asking for and giving directions'),(140,'es_ES','Discute los pasos que hay que seguir, planteando sugerencias y respondiendo a las sugerencias de los demás, pidiendo y dando indicaciones'),(140,'fr_FR','Peut discuter de ce que l\'on fera ensuite, répondre à des suggestions et en faire, demander des directives et en donner'),(141,'de_DE','Kann sich bei einfachen Routineaufgaben verständigen und dabei einfache Wendungen gebrauchen, um Dinge zu erbitten oder zu geben, einfache Informationen zu erfragen und zu besprechen, was man als Nächstes tun sollte'),(141,'en_US','Can communicate in simple and routine tasks using simple phrases to ask for and provide things, to get simple information and to discuss what to do next'),(141,'es_ES','Es capaz de comunicarse en tareas cotidianas utilizando frases sencillas para pedir y ofrecer cosas, para conseguir información sencilla y para discutir los pasos que hay que seguir'),(141,'fr_FR','Peut communiquer au cours de simples tâches courantes en utilisant des expressions simples pour avoir des objets et en donner, pour obtenir une information simple et discuter de la suite à donner'),(142,'de_DE','Kann in einem Interview einfache Fragen beantworten und auf einfache Feststellungen reagieren'),(142,'en_US','Can answer simple questions and respond to simple statements in an interview'),(142,'es_ES','Responde a preguntas y afirmaciones sencillas durante una entrevista'),(142,'fr_FR','Peut répondre à des questions simples et réagir à des déclarations simples dans un entretien'),(143,'de_DE','Kann sich in einem Interview verständlich machen und Informationen und Ideen zu vertrauten Themen mitteilen, vorausgesetzt, er/sie kann gelegentlich um Klärung bitten und erhält Hilfe, das auszudrücken, was er/sie sagen möchte'),(143,'en_US','Can make him/herself understood in an interview and communicate ideas and information on familiar topics, provided he/she can ask for clarification occasionally, and is given some help to express what he/she wants to'),(143,'es_ES','Se hace comprender en una entrevista y cuando comunica ideas e información sobre temas cotidianos, siempre que pueda pedir de vez en cuando que le aclaren lo dicho y que le ayuden a expresar lo que quiere decir'),(143,'fr_FR','Peut se faire comprendre dans un entretien et communiquer des idées et de l\'information sur des sujets familiers à condition de pouvoir faire clarifier à l\'occasion et d\'être aidé pour exprimer ce qu\'il/elle veut'),(144,'de_DE','KANN ein Telefongespräch führen und einfache, vorbereitete Nachrichten weitergeben, z. B. \"Der Flug von Herrn X hat Verspätung; er kommt heute nachmittag an.\"'),(144,'en_US','CAN make an outgoing call and pass on simple, prepared messages, for example \'Mr X\'s flight is late; he will arrive this afternoon\''),(144,'es_ES','PUEDE realizar una llamada y transmitir mensajes preparados muy sencillos, por ejemplo, \"El vuelo del señor X viene con retraso; él llagará esta tarde\"'),(144,'fr_FR','EST CAPABLE de faire un appel et de laisser de simples messages déjà préparés, comme par exemple, \'Le vol de Mr. X est en retard ; il arrivera cet après-midi\"'),(145,'de_DE','KANN alltägliche Bedürfnisse innerhalb des eigenen Arbeitsbereichs benennen (z. B. um die Erledigung von Schreibarbeit bitten)'),(145,'en_US','CAN state routine requirements within own area of work (e.g. asking for typing to be done)'),(145,'es_ES','PUEDE expresar peticiones rutinarias dentro de su propio ámbito de trabajo (por ejemplo, pedir que le pasen algo a máquina)'),(145,'fr_FR','EST CAPABLE de formuler des demandes courantes dans le domaine de son travail (demander qu\'un papier soit dactylographié)'),(146,'de_DE','KANN einen Besucher begrüßen und für eine begrenzte Zeit sich mit ihm unterhalten, z. B. sich erkundigen über die Reise eines Besuchers, sein Hotel etc.'),(146,'en_US','CAN greet a visitor and engage in a limited conversation for a short period of time, for example enquiring about a visitor\'s journey, hotel etc.'),(146,'es_ES','PUEDE saludar a las visitas y entablar una conversación limitada durante un corto periodo de tiempo, por ej. Interesarse por su viaje, el hotel etc.'),(146,'fr_FR','EST CAPABLE d\'accueillir un visiteur et engager une conversation avec lui durant une courte période de temps, par exemple, discuter de son voyage, de l\'hôtel, etc.'),(147,'de_DE','KANN den Kunden innerhalb des eigenen Arbeitsgebiets in einfachen Angelegenheiten beraten (z.B. Dieses Modell macht bessere Kopien, ist aber teurer)'),(147,'en_US','CAN offer advice to clients within own job area on simple matters (e.g. \'This model will give you better copies, but it is more expensive\')'),(147,'es_ES','PUEDE ofrecer consejo a clientes sobre cuestiones sencillas dentro de su propio ámbito de trabajo (por ej.\"Este modelo le proporcionará mejores copias, pero es más caro\")'),(147,'fr_FR','EST CAPABLE de donner son avis aux clients dans le domaine de son travail sur des points simples (\"Avec ce modèle vous aurez de meilleures copies, mais il est plus cher\")'),(148,'de_DE','Kann im eigenen Sachgebiet mit einer gewissen Sicherheit größere Mengen von Sachinformationen über vertraute Routineangelegenheiten und über weniger routinemäßige Dinge austauschen'),(148,'en_US','Can exchange, check and confirm accumulated factual information on familiar routine and non-routine matters within his/her field with some confidence'),(148,'es_ES','Intercambia, comprueba y confirma con cierta confianza información concreta sobre asuntos, cotidianos o no, dentro de su especialidad'),(148,'fr_FR','Peut échanger avec une certaine assurance un grand nombre d\'informations factuelles sur des sujets courants ou non, familiers à son domaine'),(149,'de_DE','Kann beschreiben, wie man etwas macht, und kann genaue Anweisungen geben '),(149,'en_US','Can describe how to do something, giving detailed instructions'),(149,'es_ES','Describe la forma de realizar algo dando instrucciones detalladas'),(149,'fr_FR','Peut expliquer comment faire quelque chose en donnant des instructions détaillées'),(150,'de_DE','Kann erklären, warum etwas ein Problem ist, kann diskutieren, was man als Nächstes tun sollte, und kann Alternativen vergleichen und einander gegenüberstellen'),(150,'en_US','Can explain why something is a problem, discuss what to do next, compare and contrast alternatives'),(150,'es_ES','Explica los motivos de un problema, discute sobre los pasos que se deben seguir, compara y contrasta alternativas'),(150,'fr_FR','Peut expliquer pourquoi quelque chose pose problème, discuter de la suite à donner, comparer et opposer les solutions'),(151,'de_DE','Kann die Standpunkte anderer kurz kommentieren'),(151,'en_US','Can give brief comments on the views of others'),(151,'es_ES','Realiza breves comentarios sobre los puntos de vista de otras personas'),(151,'fr_FR','Peut commenter brièvement le point de vue d\'autrui'),(152,'de_DE','Kann in einem Interview- oder Konsultationsgespräch konkrete Auskünfte geben (z.B. beim Arzt Symptome beschreiben), tut das aber mit begrenzter Genauigkeit'),(152,'en_US','Can provide concrete information required in an interview but does so with limited precision'),(152,'es_ES','Proporciona la información concreta que se requiere en una entrevista o en una consulta (por ejemplo, describe síntomas a un médico), pero lo hace con una precisión limitada'),(152,'fr_FR','Peut fournir des renseignements concrets exigés dans un entretien ou une consultation (par exemple, décrire des symptômes à un médecin) mais le fait avec une précision limitée'),(153,'de_DE','KANN in einem Gespräch seine Meinung überzeugend darstellen, z. B. über ein bekanntes Produkt'),(153,'en_US','CAN put her/his point across persuasively when talking, for example about a familiar product'),(153,'es_ES','PUEDE expresar su punto de vista de manera convincente al hablar, por ejemplo, de un producto conocido'),(153,'fr_FR','EST CAPABLE d\'exposer son opinion et d\'être convaincant quand il parle, par exemple, d\'un produit familier'),(154,'de_DE','Kann klar, detailliert beschreiben, wie bei einem Verfahren vorgegangen werden kann'),(154,'en_US','Can give a clear, detailed description of how to carry out a procedure'),(154,'es_ES','Realiza descripciones claras y detalladas acerca de la forma de llevar a cabo un procedimiento '),(154,'fr_FR','Peut faire la description claire et détaillée d\'une démarche'),(155,'de_DE','Kann komplexe Informationen und Ratschläge in Zusammenhang mit allen Dingen, die mit seinem/ihrem Beruf zu tun haben, verstehen und austauschen'),(155,'en_US','Can understand and exchange complex information and advice on the full range of matters related to his/her occupational role'),(155,'es_ES','Comprende e intercambia información compleja y consejos sobre todos los asuntos relacionados con su profesión'),(155,'fr_FR','Peut comprendre et échanger une information complexe et des avis sur une gamme étendue de sujets relatifs à son rôle professionnel'),(156,'de_DE','Kann eine Angelegenheit oder ein Problem klar darlegen, dabei Vermutungen über Ursachen und Folgen anstellen und die Vor- und Nachteile verschiedener Ansätze gegeneinander abwägen'),(156,'en_US','Can outline an issue or a problem clearly, speculating about causes or consequences, and weighing advantages and disadvantages of different approaches'),(156,'es_ES','Esboza un asunto o un problema con claridad, especulando sobre las causas o consecuencias y comparando las ventajas y desventajas de diferentes enfoque'),(156,'fr_FR','Peut esquisser clairement à grands traits une question ou un problème, faire des spéculations sur les causes et les conséquences, et mesurer les avantages et les inconvénients des différentes approches'),(157,'de_DE','Kann wirksam und flüssig ein Interviewgespräch führen, von vorbereiteten Fragen spontan abweichen, auf interessante Antworten näher eingehen und nachfragen'),(157,'en_US','Can carry out an effective, fluent interview, departing spontaneously from prepared questions, following up and probing interesting replies'),(157,'es_ES','Realiza entrevistas eficaces y fluidas, incluso alejándose espontáneamente de las preguntas preparadas, siguiendo el hilo y dando repuestas interesantes'),(157,'fr_FR','Peut conduire un entretien avec efficacité et aisance, en s\'écartant spontanément des questions préparées et en exploitant et relançant les réponses intéressantes'),(158,'de_DE','Kann seine/ihre Gedanken und Meinungen präzise ausdrücken, überzeugend argumentieren und auf komplexe Argumentationen anderer reagieren'),(158,'en_US','Can express his/her ideas and opinions with precision, present and respond to complex lines of argument convincingly'),(158,'es_ES','Expresa sus ideas y opiniones con precisión, presenta líneas argumentales complejas y responde a ellas con convicción'),(158,'fr_FR','Peut exposer ses idées et ses opinions et argumenter avec conviction sur des sujets complexes et réagir de même aux arguments d\'autrui'),(159,'de_DE','Kann zur Diskussion beitragen, den eigenen Standpunkt begründen und verteidigen, alternative Vorschläge beurteilen, Hypothesen aufstellen und auf Hypothesen anderer reagieren'),(159,'en_US','Can contribute, account for and sustain his/her opinion, evaluate alternative proposals and make and respond to hypotheses'),(159,'es_ES','Ofrece, explica y defiende sus opiniones, evalúa las propuestas alternativas, formula hipótesis y responde a éstas'),(159,'fr_FR','Peut exprimer, justifier et défendre son opinion, évaluer d\'autres propositions ainsi que répondre à des hypothèses et en faire'),(160,'de_DE','KANN Routinenachrichten aufnehmen oder hinterlassen, um Klärung oder Erläuterung bitten, falls diese undeutlich waren, wobei nur gelegentlich Mißverständnisse auftreten'),(160,'en_US','CAN take or leave routine messages, ask for clarification or elaboration where these are not expressed clearly, with only occasional misunderstanding of facts'),(160,'es_ES','PUEDE recoger o dar mensajes rutinarios y pedir aclaraciones o explicaciones detalladas si los mensajes no están claramente expresados, con sólo algún malentendido ocasional de los datos'),(160,'fr_FR','EST CAPABLE de prendre ou de laisser des messages courants, de demander des éclaircissements si ceux-ci ne sont pas exprimés clairement, faisant seulement quelques erreurs occasionnelles de compréhension'),(161,'de_DE','KANN genaue Informationen geben und Bedürfnisse äußern in einem ihm/ihr vertrauten Arbeitsbereich'),(161,'en_US','CAN give detailed information and state detailed requirements within familiar area of work'),(161,'es_ES','PUEDE aportar información detallada y establecer condiciones detalladas dentro de un campo conocido'),(161,'fr_FR','EST CAPABLE de donner des informations détaillées et formuler des demandes détaillées dans le domaine familier du travail'),(162,'de_DE','KANN erfolgreich seine Meinung vertreten und, falls erforderlich, die Notwendigkeit von Leistungen begründen und Bedürfnisse genau erklären'),(162,'en_US','CAN argue his/her case effectively, justifying, if necessary, a need for service and specifying needs precisely'),(162,'es_ES','PUEDE exponer su caso de manera eficaz, justificando, si es preciso, la necesidad de un servicio y especificando las necesidades con precisión'),(162,'fr_FR','EST CAPABLE d\'argumenter sur un cas d\'espèce, justifier, si nécessaire, le besoin d\'un service et préciser des besoins clairement'),(163,'de_DE','KANN Fragen, die nicht zu seinem/ihrem unmittelbaren Arbeitsgebiet gehören, beantworten.  '),(163,'en_US','CAN answer questions outside own immediate area of work'),(163,'es_ES','PUEDE contestar preguntas ajenas a su propio ámbito de trabajo.  '),(163,'fr_FR','EST CAPABLE de répondre à des questions sans rapport avec son domaine de travail'),(164,'de_DE','KANN ein längeres Gespräch mit einem Gast über Angelegenheiten seiner/ihrer Kompetenz führen'),(164,'en_US','CAN engage in an extended conversation with a visitor on matters within her/his authority/competence'),(164,'es_ES','PUEDE participar en una conversación extensa con una visita sobre temas propios de su competencia'),(164,'fr_FR','EST CAPABLE de participer à une discussion assez longue avec un visiteur sur des sujets de sa compétence'),(165,'de_DE','KANN detaillierte Informationen geben und die meisten alltäglichen Probleme bewältigen, die anfallen könnten'),(165,'en_US','CAN give detailed information and deal with most routine problems that are likely to arise'),(165,'es_ES','PUEDE aportar información detallada y resolver los problemas más rutinarios que puedan surgir'),(165,'fr_FR','EST CAPABLE de donner des informations détaillées et de faire face à la plupart des problèmes courants'),(166,'de_DE','KANN Fragen außerhalb des eigenen direkten Arbeitsbereichs stellen (z. B. einen juristischen oder finanziellen Rat von außerhalb einholen)'),(166,'en_US','CAN ask questions outside own immediate area of work (e.g. asking for external legal or financial advice)'),(166,'es_ES','PUEDE formular preguntas ajenas a su propio ámbito de trabajo (por ej. pedir consejo legal o financiero externo)'),(166,'fr_FR','EST CAPABLE de poser des questions sans rapport avec son domaine de travail (demander un avis financier ou juridique extérieur)'),(167,'de_DE','KANN in komplizierten, heiklen und umstrittenen Angelegenheiten beraten, z.B. bei juristischen und finanzpolitischen Fragen'),(167,'en_US','CAN advise on/handle complex, delicate or contentious issues, e.g. legal or financial situations'),(167,'es_ES','PUEDE tratar o aconsejar sobre cuestiones complejas, delicadas o polémicas, por ej. Situaciones legales o financieras'),(167,'fr_FR','EST CAPABLE de conseiller/faire face aux problèmes délicats et conflictuels complexes, par exemple les situations juridiques et financières'),(168,'de_DE','Kann uneingeschränkt an einem Interview teilnehmen, sowohl als Interviewer/in als auch als Interviewte/r; kann die diskutierte Frage flüssig und ohne fremde Hilfe ausführen und entwickeln; kann gut mit Einwürfen umgehen'),(168,'en_US','Can participate fully in an interview, as either interviewer or interviewee, expanding and developing the point being discussed fluently without any support, and handling interjections well'),(168,'es_ES','Participa totalmente en una entrevista como entrevistador o como entrevistado, ampliando y desarrollando las ideas discutidas con fluidez y sin apoyo y haciendo un buen uso de las interjeccion'),(168,'fr_FR','Peut conduire un entretien avec efficacité et aisance, en s\'écartant spontanément des questions préparées et en exploitant et relançant les réponses intéressantes'),(169,'de_DE','KANN mit unvorhersehbaren Fragen umgehen'),(169,'en_US','CAN deal with unpredictable questions'),(169,'es_ES','PUEDE hacer frente a preguntas imprevisibles'),(169,'fr_FR','EST CAPABLE de traiter de questions non prévues'),(170,'de_DE','KANN erfolgreich zu Besprechungen und Seminaren innerhalb des eigenen Arbeitsgebiets beitragen'),(170,'en_US','CAN contribute effectively to meetings and seminars within own area of work'),(170,'es_ES','PUEDE contribuir de manera eficaz a reuniones y seminarios dentro de su propio ámbito de trabajo'),(170,'fr_FR','EST CAPABLE de contribuer efficacement à des réunions et des séminaires dans le domaine de son travail'),(171,'de_DE','KANN erfolgreich gegen oder für einen Standpunkt diskutieren und ist sprachlich in der Lage, die meisten Aspekte seiner/ihrer Arbeit zu besprechen'),(171,'en_US','CAN argue effectively for or against a case, and has sufficient language to be able to talk about/discuss most aspects of her/his work'),(171,'es_ES','PUEDE discutir de manera eficaz a favor o en contra de un caso, y posee el suficiente dominio del lenguaje para poder hablar/discutir sobre la mayoría de los aspectos relacionados con su trabajo'),(171,'fr_FR','EST CAPABLE d\'argumenter pour ou contre un cas et a assez de ressources langagières pour parler ou discuter de la plupart des aspects de son travail'),(172,'de_DE','KANN sicher das Telephon benutzen, auch wenn die Verbindung schlecht ist oder der Anrufer einen ungewöhnlichen Akzent hat'),(172,'en_US','CAN use the telephone confidently, even if the line is bad or the caller has a non-standard accent'),(172,'es_ES','PUEDE utilizar el teléfono con seguridad, incluso si la línea es mala o la persona que llama no tiene un acento estándar'),(172,'fr_FR','EST CAPABLE d\'utiliser le téléphone en toute confiance, même si la ligne est mauvaise ou l\'interlocuteur a un accent qui ne correspond pas aux normes standard');
