INSERT INTO `motd` VALUES (1,'Record a video-exercise  as many times as you want','After recording a video-exercise you can watch or redo it again  before publishing it?\rJust click the Watch Simultaneously or Watch Response button. Whenever you are confident\rwith your work,  click “Save Response” Button in order to be evaluated.','/img/motd1.png','2010-10-01 00:00:00',0,'1','en_US'),(2,'Graba un video-ejercicio tantas veces como quieras','Tras grabar un ejercicio podrás visualizarlo y rehacerlo tantas veces como quieras. Cuando estés satisfecho con el resultado podrás publicarlo en el servidor para que otros usuarios lo evalúen.','/img/motd1.png','2010-10-01 00:00:00',0,'1','es_ES'),(3,'Grabatu nahi beste bideo-ariketa','Ariketa bat grabatu ostean, nahi beste aldiz errepasatu edo bergrabatu dezakezu. Emaitza zure gustokoa denean\r\nzerbitzarian argitaratu dezakezu beste erabiltzaile batzuek ebaluatu dezaten','/img/motd1.png','2010-10-01 00:00:00',0,'1','eu_ES'),(4,'Did you know that you can dub your favourite actor','or actress? Do you feel lucky, punk?','/img/motd2.png','2010-10-04 00:00:00',0,'2','en_US'),(5,'Sabías que puedes doblar a tu actor...','o actriz favorita? Do you feel lucky, punk?','/img/motd2.png','2010-10-04 00:00:00',0,'2','es_ES'),(6,'Ba al zenekien zure aktore gustokoenea...','bikoiztu dezakezula? Do you feel lucky, punk?','/img/motd2.png','2010-10-04 00:00:00',0,'2','eu_ES'),(7,'Did you know that you can report an inappropiate video?','Users can report inappropiate videos, choosing the reason for banning among a frequently used reasons list.','/img/motd3.png','2010-10-03 00:00:00',0,'3','en_US'),(8,'Sabías que puedes informar de vídeos inapropiados?','Basta con que elijas la razón para denunciar el vídeo de una lista de razones frecuentes','/img/motd3.png','2010-10-03 00:00:00',0,'3','es_ES'),(9,'Did you know that you can follow us on Twitter?','Just follow the @babelium user','/img/motd6.png','2010-10-05 00:00:00',0,'4','en_US'),(10,'Sabías que puedes seguirnos en Twitter?','Sólo tienes que seguir al usuario @babelium','/img/motd6.png','2010-10-05 00:00:00',0,'4','es_ES'),(11,'Ba al zenekien Twitter-en jarrai gaitzakezula?','@babelium erabiltzailea jarraitu baino ez duzu egin behar','/img/motd6.png','2010-10-05 00:00:00',0,'4','eu_ES');
/*!40000 ALTER TABLE `motd` ENABLE KEYS */;
UNLOCK TABLES;

