ntado antes, con aquello que tenga chocolate. ',2902),(17670,1754,192.5,200,'y en este caso veo unos deliciosos pastelitos y galletas de chocolate que me gustan mucho más que las flores.',2902),(17671,1754,200.5,202.5,'Muchas gracias',2902),(17672,1755,61.95,80.07,'Responde.',2903),(17673,1755,91.7,110.19,'Responde.',2903),(17674,1755,118.88,127.55,'Pregunta.',2903),(17675,1755,138.93,144.69,'Responde.',2903),(17676,1756,51.9,55.2,'¡Uhhh! ¡Vale!, creo que ya se lo que quiero.',2904),(17677,1756,56.23,59.53,'De primero me podrías dar unos macarrones a la boloñesa',2904),(17678,1756,60.43,65.55,'y de segundo, a ser posible, un pollo asado con patatas.',2904),(17679,1756,80.64,88.58,'Creo que pediré café ¡Si! ¡traeme un café, por favor!',2904),(17680,1756,103,109.03,'¡Estaba todo muy bueno! ¡hemos terminado con todo! Cuando puedas, ¿nos puedes traer la cuenta, por favor?',2904),(17681,1756,120.09,126.74,'¡Vale! ¡Aqui tienes! ¡Muchas gracias! ¡Adios!',2904),(17682,1757,41.36,47.26,'Tu turno.',2905),(17683,1757,55.65,61.79,'Tu turno.',2905),(17684,1757,69.42,75.25,'Tu turno.',2905),(17685,1757,83.69,89.69,'Tu turno.',2905),(17686,1758,41.26,46.01,'¡Si! ¡Por favor! Estaba buscando unos libros.',2906),(17687,1758,55.44,60.13,'Eran unas novelas de aventuras.',2906),(17688,1758,72.29,81.42,'Si, uno de ellos era Julio Verner, y el otro ... Carlos Ruíz Zafón, creo.',2906),(17689,1758,90.01,95.69,'¡Claro! ¡Muchas gracias!',2906),(17690,1759,61.48,67.07,'Tu turno.',2907),(17691,1759,68.41,73.97,'Tu turno.',2907),(17692,1759,75.13,80.97,'Tu turno.',2907),(17693,1759,82.05,87.85,'Tu turno.',2907),(17694,1759,88.88,94.98,'Tu turno.',2907),(17695,1759,95.98,101.93,'Tu turno.',2907),(17696,1759,102.95,108.94,'Tu turno.',2907),(17697,1759,110.11,115.67,'Tu turno.',2907),(17698,1760,61.74,67.05,'Tu turno.',2908),(17699,1760,68.88,74.06,'Tu turno.',2908),(17700,1760,76.16,81.68,'Tu turno.',2908),(17701,1760,82.69,88.71,'Tu turno.',2908),(17702,1760,89.71,95.68,'Tu turno.',2908),(17703,1